import React from 'react'

function ViewFlights() {


    const data=[{name:'a'},{name:'b'}]

    return (
        <div>
            <h1>Hello</h1>
            {
                data.map((e)=>{
                    return(
                        <h1>{e.name}
                        </h1>
                    )
                })
            }
        </div>
    )
}

export default ViewFlights
